import React from "react";
import "./GCPResources.css";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

function GCPResources() {
  return (
    <div>
      <Router>
        <Switch>
          <Route path="/gcp_resources"></Route>
        </Switch>
      </Router>
    </div>
  );
}

export default GCPResources;
